import { Component } from 'react'

export default class Timer extends Component {
  state = {
    time: '12:25',
  }
  render() {
    return (
      <span className="description">
        <button className="icon icon-play"></button>
        <button className="icon icon-pause"></button>
        {this.state.time}
      </span>
    )
  }
}
